import React from "react";
import items from "./Items";
import "./FoodItem.css";
import Form from "./Form";

const FoodItems = () => {
  return (
    <>
      {console.log(items, "jakkaka")}
      <ul className="item">
        {items.map((item) => (
          <div key={item.id}>
          <div>

          </div>
           
            <Form />
          </div>
        ))}
      </ul>
    </>
  );
};

export default FoodItems;
